import { useLocation } from "react-router";

export default function Header() {
    const location = useLocation();

    function pathMatchRoute (route) {
        if (route === location.pathname) {
            return true
        }
    }
  return (
    <div className="bg-white border-b shadow-sm sticky">
        <header className="flex justify-between items-center px-3 max-w-6xl mx-auto">
            <div>
            <img src="https://i.ibb.co/ftd8S6c/preview2.jpg" alt="logo" border="0" className="h-14 cursor-pointer "/>
            </div>
            <div>
                <ul className="flex  space-x-10">
                    <li className= {`py-3 text-sm font-semibold text-gray-400 border-b-[3px] border-b-transparent
                    ${pathMatchRoute("/") && "text-black border-b-red-400"}`}>Home</li>
                    <li className= {`py-3 text-sm font-semibold text-gray-400 border-b-[3px] border-b-transparent
                    ${pathMatchRoute("/offers") && "text-black border-b-red-400"}`}>Offers</li>
                    <li className= {`py-3 text-sm font-semibold text-gray-400 border-b-[3px] border-b-transparent
                    ${pathMatchRoute("/sign-in") && "text-black border-b-red-400"}`}>Sign in</li>
                </ul>
            </div>
        </header>
    </div>
  )
}
